    name: 'Home',
    to: '/dashboard',
    icon: 'cil-home',
  },
  {
    _tag: 'CSidebarNavDropdown',
    name: 'Browse All Plans',
    route: '/base',
    icon: 'cil-puzzle',
    _children: [
      {
        _tag: 'CSidebarNavItem',
        name: '1 Bedroom',
        to: '/base/breadcrumbs',
      },
      {
        _tag: 'CSidebarNavItem',
        name: '2 Bedrooms',
        to: '/base/cards',
      },
      {
        _tag: 'CSidebarNavItem',
        name: '3 Bedrooms',
